package main

import "fmt"

func increasingTriplet(nums []int) bool {
	ln := len(nums)
	if ln < 3 {
		return false
	}
	for j := 0; j < ln-2; j++ {
		for k := j + 1; k < ln-1; k++ {
			for l := k + 1; l < ln; l++ {
				if nums[j] < nums[k] && nums[k] < nums[l] {
					fmt.Println(j, k, l)
					return true
				}
			}
		}
		// if nums[j] <= nums[j+1] && nums[j+1] <= nums[j+2] {
		// 	return true
		// }
	}
	return false
}

